// ComponentB.js
import React from 'react';
import withTimeTracking from '..//hoc/withTimeTracking';

const ComponentB = ({ timeSpent }) => {
  return <div>Time spent on Component B: {timeSpent} seconds</div>;
};

export default withTimeTracking(ComponentB);
